    end 
    else begin 
      if (snkDone == 1) begin
        if (testFailure == 0)
              $display("**************TEST COMPLETED (PASSED)**************");
        else
              $display("**************TEST COMPLETED (FAILED)**************");
      end
    end
  end // completed_msg;

  // -------------------------------------------------------------
  // System Clock (fast clock) and reset
  // -------------------------------------------------------------

  always  // clock generation
  begin // clk_gen
    clk <= 1'b1;
    # clk_high;
    clk <= 1'b0;
    # clk_low;
    if (snkDone == 1) begin
      clk <= 1'b1;
      # clk_high;
      clk <= 1'b0;
      # clk_low;
      $stop;
    end
  end  // clk_gen

  initial  // reset block
  begin // reset_gen
    reset <= 1'b1;
    # (clk_period * 2);
    @ (posedge clk);
    # (clk_hold);
    reset <= 1'b0;
  end  // reset_gen

  // -------------------------------------------------------------
  // Testbench clock enable
  // -------------------------------------------------------------

  always @ (posedge clk or posedge reset)
    begin: tb_enb_delay
      if (reset == 1'b1) begin
        tbenb_dly <= 1'b0;
      end
      else begin
        if (tb_enb == 1'b1) begin
          tbenb_dly <= tb_enb;
        end
      end
    end // tb_enb_delay

  always @(snkDone, tbenb_dly)
  begin
    if (snkDone == 0)
      rdEnb <= tbenb_dly;
    else
      rdEnb <= 0;
  end

  // -------------------------------------------------------------
  // Read the data and transmit it to the DUT
  // -------------------------------------------------------------

  always @(posedge clk or posedge reset)
  begin
    data_in_data_log_task(clk,reset,
                          data_in_data_log_rdenb,data_in_data_log_addr,
                          data_in_data_log_done);
  end

  assign data_in_data_log_rdenb = rdEnb;

  always @ (data_in_data_log_rdenb, data_in_data_log_addr)
  begin // stimuli_data_in_data_log_data_in
    if (data_in_data_log_rdenb == 1) begin
      data_in <= # clk_hold data_in_data_log_force[data_in_data_log_addr];
    end
  end // stimuli_data_in_data_log_data_in

  // -------------------------------------------------------------
  // Create done signal for Input data
  // -------------------------------------------------------------

  assign srcDone = data_in_data_log_done;


  always @ (posedge clk or posedge reset)
    begin: ceout_delayLine
      if (reset == 1'b1) begin
        delayLine_out <= 1'b0;
      end
      else begin
        if (clk_enable == 1'b1) begin
          delayLine_out <= rdEnb;
        end
      end
    end // ceout_delayLine

  assign expected_ce_out =  delayLine_out & clk_enable;

  // -------------------------------------------------------------
  //  Checker: Checking the data received from the DUT.
  // -------------------------------------------------------------

  always @(posedge clk or posedge reset)
  begin
    data_out_task(clk,reset,
                  data_out_rdenb,data_out_addr,
                  data_out_done);
  end

  assign data_out_rdenb = expected_ce_out;

  assign data_out_ref = data_out_expected[data_out_addr];


  always @ (posedge clk or posedge reset) // checker_data_out
  begin
    if (reset == 1) begin
      data_out_timeout <= 0;
      data_out_testFailure <= 0;
      data_out_errCnt <= 0;
    end 
    else begin 
      if (data_out_rdenb == 1 ) begin 
        data_out_timeout <= 0;
        if (abs_real($bitstoreal(data_out) - data_out_expected[data_out_addr]) > 1.0e-9) begin
           data_out_errCnt <= data_out_errCnt + 1;
           data_out_testFailure <= 1;
               $display("ERROR in data_out at time %t : Expected '%f' Actual '%f'", 
                    $time, data_out_expected[data_out_addr], $bitstoreal(data_out));
           if (data_out_errCnt >= MAX_ERROR_COUNT) 
             $display("Warning: Number of errors for data_out have exceeded the maximum error limit");
        end

      end
      else if (data_out_timeout > MAX_TIMEOUT && data_out_rdenb == 1 ) begin 
        data_out_errCnt <= data_out_errCnt + 1;
        data_out_testFailure <= 1;
        $display ("Error: Timeout - Data was not received for data_out.");
        $stop;
      end
      else if (data_out_rdenb == 1) begin
        data_out_timeout <= data_out_timeout + 1 ;
      end
    end
  end // checker_data_out

  always @ (posedge clk or posedge reset) // checkDone_1
  begin
    if (reset == 1)
      check1_Done <= 0;
    else if ((check1_Done == 0) && (data_out_done == 1) && (data_out_rdenb == 1))
      check1_Done <= 1;
  end

  // -------------------------------------------------------------
  // Create done and test failure signal for output data
  // -------------------------------------------------------------

  assign snkDone = check1_Done;

  assign testFailure = data_out_testFailure;

  // -------------------------------------------------------------
  // Global clock enable
  // -------------------------------------------------------------
  always @(snkDone, tbenb_dly)
  begin
    if (snkDone == 0)
      # clk_hold clk_enable <= tbenb_dly;
    else
      # clk_hold clk_enable <= 0;
  end

 // Assignment Statements



endmodule // basicfir_tb
